Nixago offers various engines which can be used for transforming input data to the output file. By default, Nixago will use pkgs.formats from the internal Nix library. let configData = { "field1" = "value1"; "field2" = true; };
in
nixago.lib.make { inherit configData; output = "config.json"; format = "json";
} This is functionally equivalent to: let configData = { "field1" = "value1"; "field2" = true; };
in
nixago.lib.make { inherit configData; output = "config.json"; format = "json"; engine = nixago.engines.nix { };
} The first example omitted the engine attribute as it is the default value used when an engine isn't specified. The result of this invocation will be an attribute set with two attributes: configFile: A derivation for building the configuration file shellHook: A shell hook for managing the file Building the derivation produces a file with the following output: { "field1": "value1", "field2": true
} The generated shell hook invokes the following script: #!/nix/store/63a4li401f423jl8v5pwjwmyzlwd3lk9-bash-5.1-p16/bin/bash
# Check if the link is pointing to the existing derivation result
if readlink config.json >/dev/null \ && [[ $(readlink config.json) == /nix/store/gzf07xc8563kzvh157i27zpkr3cifzdv-config.json ]]; then log "config.json link is up to date"
elif [[ -L config.json || ! -f config.json ]]; then # otherwise we need to update log "config.json link updated" # Relink to the new result unlink config.json &>/dev/null ln -s /nix/store/gzf07xc8563kzvh157i27zpkr3cifzdv-config.json config.json # Run extra shell hook else # this was an existing file error "refusing to overwrite config.json"
fi

6.body:
When using CUE, you will typically define one or more CUE files that will be merged into the desired output. For example, if we had the below CUE file: name: string
name: "John Doe" We could then export it and get the following result: $ cue export file.cue
{ "name": "John Doe"
} When CUE is presented with multiple files, they are all merged into one singular output: name: string name: "John Doe" $ cue export file1.cue file2.cue
{ "name": "John Doe"
}

